s($,"alA","Io",function(){return H.b([A.aT("Aplicativo de busca de rastreadores por serial LoRa\n\n* Para efetuar login \xe9 necess\xe1rio ter uma conta de Representante T\xe9cnico da CEABS Servi\xe7os S.A. Em caso de d\xfavidas entre em contato com a central de atendimento. Mais informa\xe7\xf5es em nosso website","assets/works/ic_ceabs_lora_busca.png","https://play.google.com/store/apps/details?id=br.com.ceabs.lorasearch","CEABS LoRa Busca"),A.aT("O APP YCard \xe9 a forma mais f\xe1cil que existe para voc\xea emitir sua Carteirinha de Estudante (CIE) da UDFE (Uni\xe3o Democr\xe1tica da For\xe7a Estudantil).\n\n*Consulte condi\xe7\xf5es em www.ycard.com.br","assets/works/ic_udfe_ycard_carteirinha_de_estudante.png","https://play.google.com/store/apps/details?id=br.com.m2sys.ycard","UFDE YCard Carteirinha de Estudantre"),A.aT("Aplicativo de fechamento de ordem de servi\xe7os.\n\n* Para efetuar login \xe9 necess\xe1rio ter uma conta de Representante T\xe9cnico da CEABS Servi\xe7os S.A. Em caso de d\xfavidas entre em contato com a central de atendimento. Mais informa\xe7\xf5es em nosso website.","assets/works/ic_ceabs_auto_closing.webp","https://play.google.com/store/apps/details?id=com.ceabs.autoclosing","CEABS Auto Closing"),A.aT("Novo aplicativo Dirija Bem da Bradesco Seguros.\n\nCom esse aplicativo voc\xea poder\xe1 analisar todas as suas viagens realizadas, al\xe9m de acompanhar a evolu\xe7\xe3o do seu comportamento no tr\xe2nsito.\n\nUtilizando os sensores de seu smartphone, o aplicativo coletar\xe1 informa\xe7\xf5es sobre a qualidade da sua condu\xe7\xe3o. Para isso, n\xe3o \xe9 necess\xe1ria nenhuma a\xe7\xe3o para iniciar uma viagem, apenas fixe o smartphone em algum local no interior do seu ve\xedculo durante o percurso.\n\nInforma\xe7\xf5es como hor\xe1rio, dist\xe2ncia, velocidade e suavidade da condu\xe7\xe3o ser\xe3o utilizadas para gerar um score para cada viagem, e um score geral de comportamento no tr\xe2nsito, do usu\xe1rio.\n\nBaixe gratuitamente o aplicativo e avalie sua dirigibilidade.","assets/works/ic_bradesco_seguros_dirija_bem.webp","https://play.google.com/store/apps/details?id=br.com.wdev.dirijabem","Bradesco Seguros - Dirija Bem"),A.aT("Bem-vindo ao mundo dos carros conectados. A Liberty Seguros oferece uma nova forma de voc\xea se relacionar com o seu seguro.\n\nPara utilizar este aplicativo voc\xea precisar\xe1 conectar o dispositivo fornecido pela Liberty no seu ve\xedculo.\n\nCom o equipamento instalado voc\xea ter\xe1 acesso a diversos servi\xe7os que incluem:\n\n- Comportamento no tr\xe2nsito;\n- Score do motorista;\n- Detalhes de viagens;\n- Auxilio na busca pelo ve\xedculo estacionado (\xdaltima posi\xe7\xe3o).","assets/works/ic_liberty_carro_conectado.webp","https://play.google.com/store/apps/details?id=br.com.libertyseguros.carroconectado","Liberty Carro Conectado"),A.aT("*Only for subscribers\n\nBroadcast \u2013 real time news, quotes and analyses for decision-making anywhere.\n\nKey features:\nLatest\nnews\nReal time quotes\nDaily and Intraday\nChart\nWorld Indexes\nNational & International Markets\nInformation\nWatchlists\nCross Rates\nMarket Radar\nCommodities","assets/works/ic_ae_broadcast.webp","https://play.google.com/store/apps/details?id=br.livetouch.estadao","AE Broadcast+"),A.aT("O Bolsa de Valores App \xe9 uma \xf3tima op\xe7\xe3o para fazer o acompanhamento da situa\xe7\xe3o e movimenta\xe7\xe3o de diversas bolsas de valores. O aplicativo funciona em dispositivos m\xf3veis com sistema operacional Android e mostra para o usu\xe1rio como \xe9 a vida de um corretor de valores mobili\xe1rios. A vantagem \xe9 que o aplicativo simplifica a gest\xe3o do dinheiro com as informa\xe7\xf5es que fornece no seu celular ou tablet.\n\nA interface desse aplicativo \xe9 bastante simples, permitindo que voc\xea esteja sempre bem informado a respeito do \u201csobe e desce\u201d das a\xe7\xf5es de sua carteira praticamente em tempo real \u2014 essas informa\xe7\xf5es sofrem atualiza\xe7\xf5es a cada 15 minutos, em rela\xe7\xe3o ao mercado real.","assets/works/ic_bm_fbovespa.png","https://play.google.com/store/apps/details?id=br.bovespa","BM&F Bovespa"),A.aT("Atuando de 2004 at\xe9 2015, a MalaPronta.com foi uma das principais empresas brasileiras em reservas online de hot\xe9is. Sempre comprometida em oferecer o melhor pre\xe7o aos seus clientes, possuia hot\xe9is com at\xe9 50% de desconto em suas di\xe1rias e diversas promo\xe7\xf5es. Atrav\xe9s deste aplicativo voc\xea podia: \n- Pesquisar e reservar hot\xe9is;\n- Acompanhar, alterar e cancelar suas reservas;\n- Favoritar os hot\xe9is que mais gostar;\n- Se informar sobre a opini\xe3o de outros hospedes em rela\xe7\xe3o a todos os hot\xe9is que eram oferecidos; E mais: voc\xea podia enviar cart\xf5es postais digitais das suas viagens diretamente do seu smartphone para sua fam\xedlia e amigos.\nOs melhores hot\xe9is do Brasil estavam na MalaPronta.com!","assets/works/ic_malapronta_com.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.smartphone","MalaPronta.com"),A.aT("O HotelAPP by MalaPronta.com \xe9 uma plataforma de reservas online que os h\xf3spedes podem baixar em seus smartphones. \xc9 um aplicativo com o nome e a marca de seu hotel, criado a partir da tecnologia propriet\xe1ria da MalaPronta.com. Esteja onde estiver, o cliente poder\xe1 acessar o aplicativo, realizar uma reserva e aproveitar o melhor do seu hotel.\n\nPara mais informa\xe7\xf5es acesse: http://www.malapronta.com.br/hotelapp","assets/works/ic_generic_hotel_app.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.generic","HotelAPP by MalaPronta.com"),A.aT("Localizado na regi\xe3o central de Curitiba, em frente a Pra\xe7a Rui Barbosa o Gua\xedra Palace Hotel oferece uma hospedagem com excelente custo benef\xedcio. A dist\xe2ncia at\xe9 o Aeroporto Afonso Pena \xe9 de 18quil\xf4metros, a rodovi\xe1ria fica a 3 Km e os atrativos tur\xedsticos como a Rua 24 horas e a Rua das Flores voc\xea pode ir caminhando, ficando a poucas quadras do hotel.Os apartamentos s\xe3o decorados com simplicidade e praticidade para uma excelente noite de sono. Possui ar condicionado, piso laminado, TV LCD a cabo, frigobar, telefone e banheiro privativo comaquecimento central de \xe1gua.Al\xe9m disso, oferece restaurante e recep\xe7\xe3o 24 horas. O caf\xe9 da manh\xe3 tamb\xe9m est\xe1 incluso na di\xe1ria, e \xe9 servido todas as manh\xe3s em estilo buffet. O estacionamento \xe9 privativo e cortesia para suacomodidade e seguran\xe7a.","assets/works/ic_hotel_guaira_palace.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel4982","Hotel Gua\xedra Palace"),A.aT("Desde sua funda\xe7\xe3o a empresa conquistou um espa\xe7o importante neste mercado pelo desempenho em solu\xe7\xf5es inovadoras e pelo relacionamento positivo com seus clientes, colaboradores e parceiros deneg\xf3cio.Buscando efic\xe1cia de resultados e performance din\xe2mica, disponibiliza servi\xe7os de alta qualidade, os valores que norteiam o Grupo s\xe3o transpar\xeancia, honestidade, lucratividade e \xe9tica nos neg\xf3ciose a valoriza\xe7\xe3o da forma\xe7\xe3o e capacita\xe7\xe3o de seus colaboradores.Fazem parte do grupo:O Riema \xc1ustria \xe9 um hotel \xfanico na regi\xe3o de Americana, onde todas as acomoda\xe7\xf5es s\xe3o su\xedtes planejadas para proporcionar conforto e funcionalidade para quem est\xe1 viajando a neg\xf3cios ou que tenhauma perman\xeancia mais longa na cidade. Estilo e bom gosto s\xe3o palavras-chave para descrev\xea-lo.A localiza\xe7\xe3o \xe9 nobre e o hotel est\xe1 pr\xf3ximo a excelentes Bares, Restaurantes e Shopping Center.\u2028Os apartamentos s\xe3o amplos e possui sacada, cama box, esta\xe7\xe3o de trabalho, TV de LDC 32\u2019 suspensa,mini kitchen, acesso free a internet wireless e aos canais de TV a cabo NET.Riema Paulista Classic est\xe1 entre as ruas da Consola\xe7\xe3o e Haddock Lobo, oferecendo r\xe1pido acesso para v\xe1rios bairros da cidade e esta\xe7\xf5es do metro. Pr\xf3ximo aos Centros de Evento S\xe3o Luiz, Rebou\xe7ase Frei Caneca e aos Hospitais 9 de julho e Cl\xednicas.Os apartamentos s\xe3o amplos e possuem sacada, cama Box, esta\xe7\xe3o de trabalho, TV de LDC 32\u2019, mini kitchen, acesso free a internet wireless e aos canais de TV a cabo NET, atendendo as necessidades dequem vem a neg\xf3cios ou a lazer. Disp\xf5e de um centro de conven\xe7\xf5es pronto para receber seu evento e possui \xe1rea de lazer com piscina, sauna e fitness center.Riema Saint Charbel \xe9 uma excelente op\xe7\xe3o para pessoas que vem a S\xe3o Paulo em tratamento m\xe9dico com seus familiares, j\xe1 que o empreendimento fica pr\xf3ximo aos Hospitais S\xedrio Liban\xeas e Nove deJulho. Tamb\xe9m para aqueles que v\xeam a neg\xf3cios e lazer, pois est\xe1 pr\xf3ximo do Centro de Compras, Av. Paulista, Shopping Frei Caneca e Centros de Conven\xe7\xf5es S\xe3o Lu\xeds e Fecomercio.Os apartamentos possuem banheiros amplos, portas dimensionadas, pisos antial\xe9rgicos, sacada, cama Box, esta\xe7\xe3o de trabalho, TV de LDC 32\u2019, mini kitchen, acesso free a internet wireless e aoscanais de TV a cabo NET.\xc1rea de lazer com piscina, sauna, fitness center e jacuzzi. O bem estar, da sua casa, traduzidos em apartamentos confort\xe1veis e bem equipados. Possui um ambiente acolhedor, preparado para oferecero melhor para sua estada.","assets/works/ic_riema_hoteis.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.chain128","Riema Hot\xe9is"),A.aT("Localizado no centro do Rio de Janeiro, e com f\xe1cil acesso aos principais pontos tur\xedsticos da cidade, o Hotel Pouso Real \xe9 o lugar perfeito para quem procura conforto, servi\xe7os de qualidade elocaliza\xe7\xe3o estrat\xe9gica.Todos os apartamentos do estabelecimento contam com telefone, ar condicionado, frigobar, TV a cabo, banheiro privativo e acesso \xe0 internet Wi-Fi por um custo adicional. Para maior comodidade deseus h\xf3spedes, o restaurante do hotel serve diariamente um delicioso buffet de caf\xe9 da manh\xe3, al\xe9m de refei\xe7\xf5es para almo\xe7o e jantar. O estacionamento do local est\xe1 dispon\xedvel e \xe9 cortesia.Aproveite o melhor que a Cidade Maravilhosa tem a oferece hospedado em um hotel com excelente localiza\xe7\xe3o, servi\xe7os de primeira e muito conforto. Conhe\xe7a as vantagens de se hospedar no Hotel PousoReal.","assets/works/ic_hotel_pouso_real.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel1270","Hotel Pouso Real"),A.aT("Rede San Raphael conta com os hot\xe9is:O San Raphael Hotel est\xe1 localizado na \xe1rea nobre do Centro de S\xe3o Paulo, no belo e arborizado Largo do Arouche, e apenas a 500 metros da esta\xe7\xe3o Rep\xfablica (Linha Vermelha e Amarela) do metr\xf4,ampliando a conveni\xeancia de locomo\xe7\xe3o dos h\xf3spedes que visitem a cidade a neg\xf3cios ou para turismo de lazer.Com arquitetura neo-cl\xe1ssica, apartamentos amplos, qualidade no atendimento, versatilidade de salas de eventos e gastronomia diferenciada, este Hotel \xe9 a sua melhor op\xe7\xe3o de hospedagem no Centroda cidade.Inaugurado h\xe1 mais de 40 anos, ele preserva o charme e a eleg\xe2ncia hist\xf3rica da cidade. Est\xe1 localizado no belo Largo do Arouche, uma pra\xe7a tranquila, segura e arborizada, reconhecida por seuspequenos edif\xedcios comerciais e residenciais de porta-balc\xe3o e sacada, por sua rom\xe2ntica banca de flores, al\xe9m de muitos restaurantes tradicionais. O Largo \xe9 enriquecido por diversas \xe1rvores e obrasde arte, como a escultura em bronze \u201cDepois do Banho\u201d de Victor Brecheret.O hotel econ\xf4mico San Michel est\xe1 convenientemente localizado no centro de S\xe3o Paulo. Com arquitetura moderna, estrutura intimista, apartamentos amplos e qualidade nos servi\xe7os, este Hotelecon\xf4mico \xe9 a sua melhor op\xe7\xe3o de hospedagem no Centro da cidade.Inaugurado h\xe1 mais de 30 anos, o San Michel Hotel \xe9 sin\xf4nimo de conveni\xeancia, praticidade, sem abrir m\xe3o do \xf3timo custo benef\xedcio.Est\xe1 estrategicamente localizado no Largo do Arouche, regi\xe3o nobre do Centro de S\xe3o Paulo, cercado de \xe1rvores, edif\xedcios comerciais e residenciais, al\xe9m da banca de flores e de muitos restaurantesde qualidade. O Hotel est\xe1 ao lado da Av. S\xe3o Jo\xe3o.","assets/works/ic_san_raphael_hotel.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.chain224","San Raphael Hotel"),A.aT("At\xe9 hoje a rede Othon n\xe3o para de crescer. S\xe3o v\xe1rios hot\xe9is espalhados pelo Brasil e pelo mundo, todos com a qualidade de uma rede hoteleira que tem tradi\xe7\xe3o e experi\xeancia. Para qualquer tipo de viagem, voc\xea pode contar com Hot\xe9is Othon, a rede que est\xe1 presente nos mais diversos lugares.\n\nBandeira Palace: Os hot\xe9is da categoria Othon Palace est\xe3o preparados para agradar aos clientes mais exigentes \u2013 de executivos viajando a neg\xf3cios a fam\xedlias curtindo f\xe9rias \u2013, oferecem tudo o que os melhores cinco estrelas podem oferecer: luxo, conforto, cozinha internacional, servi\xe7o discreto e eficiente.\n\nBandeira Su\xedtes: Para clientes que precisam de hospedagem de longa dura\xe7\xe3o, a Rede Othon criou o segmento Su\xedtes. Nesses hot\xe9is, nosso h\xf3spede encontrar\xe1 toda a infra-estrutura para se sentir confort\xe1vel como se estivesse em sua pr\xf3pria casa.","assets/works/ic_hoteis_othon.webp","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.chain71","Hot\xe9is Othon"),A.aT("A Rede Mabu Hot\xe9is & Resorts possui ampla experi\xeancia de mais de 40 anos em hotelaria, preservando valores como respeito, honestidade, hospitalidade, flexibilidade, inova\xe7\xe3o, empreendedorismo e sustentabilidade. Por isso, investimos em qualidade e em medidas socioambientais, apoiando a preserva\xe7\xe3o do meio ambiente e garantindo um contato harm\xf4nico entre o homem e a natureza.","assets/works/ic_mabu_hoteis.webp","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.chain99","Mabu Hot\xe9is"),A.aT("Em 1992 foi criada a primeira empresa do Grupo, M&C Viagens e Turismo, onde faz\xedamos reservas de flats em todo o Brasil e exterior. Devido ao aumento da procura por apartamentos com alto padr\xe3o de qualidade, decidimos ingressar no mercado de administra\xe7\xe3o de im\xf3veis, criando um novo conceito de rentabilidade para os nossos propriet\xe1rios investidores nos principais flats do Rio de Janeiro.\n\nNosso objetivo \xe9 promover uma hospedagem que garanta sustentabilidade, competitividade e atratividade, mantendo a gera\xe7\xe3o do conhecimento e compromisso social. Valorizamos nossa hist\xf3ria de 20 anos com \xe9tica, integridade e excel\xeancia, e temos orgulho em manter esta tradi\xe7\xe3o.","assets/works/ic_mc_flats.webp","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.chain557","MC Flats"),A.aT("No cora\xe7\xe3o de um para\xedso natural, o Cost\xe3o do Santinho alia localiza\xe7\xe3o privilegiada e infraestrutura completa para todas as idades. Estar no resort \xe9 viver momentos inesquec\xedveis em fam\xedlia. Deixe as preocupa\xe7\xf5es na recep\xe7\xe3o e concentre-se apenas em desfrutar da mais completa estrutura de lazer em uma das mais belas paisagens do Brasil. Premiado sete vezes como o melhor resort de praia do pa\xeds, o Cost\xe3o oferece uma estrutura de padr\xe3o internacional, centenas de atividades o ano inteiro, com recrea\xe7\xe3o infantil, shows nacionais, seis restaurantes exclusivos, conjunto de piscinas aquecidas e SPA.","assets/works/ic_costao_do_santinho.webp","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel559","Cost\xe3o do Santinho"),A.aT("O Dorisol Recife Grand Hotel, est\xe1 localizado em Jaboat\xe3o dos Guararapes, regi\xe3o metropolitana de Recife (PE), frente a Praia da Piedade. O Hotel encontra-se a aproximadamente 9 Km de dist\xe2ncia doAeroporto Internacional de Recife e a 3 Km da Esta\xe7\xe3o Ferrovi\xe1ria Cajueiro Seco.\nTodas as acomoda\xe7\xf5es possuem vista para a Praia da Piedade e est\xe3o equipadas com ar-condicionado, TV a cabo, telefone, conex\xe3o com Internet (wi-fi e a Cabo), frigobar, banheiros privativos, cofre esecador de cabelo.\nO Hotel possui restaurante pr\xf3prio, no qual s\xe3o servidos caf\xe9 da manh\xe3 (incluso na di\xe1ria), almo\xe7o e jantar com pratos t\xedpicos da regi\xe3o. Para maior comodidade dos h\xf3spedes o Dorisol conta comestacionamento, Sala de internet gr\xe1tis (no lobby do hotel), servi\xe7os de copa, servi\xe7os de quarto, mensageiro e sal\xf5es para a realiza\xe7\xe3o de eventos.\nPara usufruir dos momentos de lazer, al\xe9m da praia de frente para o hotel, os h\xf3spedes t\xeam \xe0 disposi\xe7\xe3o, piscinas para adultos e crian\xe7as, espa\xe7o de jogos, playground para crian\xe7as, academia e SPA(com servi\xe7os de massagem, ofur\xf4, hidromassagem e sauna","assets/works/ic_dorisol_recife_grand_hotel.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel4135","Dorisil Recife Grand Hotel"),A.aT("Estrategicamente localizado em Uberl\xe2ndia, pr\xf3ximo ao Center Shopping e Center Convention, o Executive Inn Hotel oferece f\xe1cil acesso a qualquer ponto da cidade. Sua estrutura \xe9 requintada e pensada para que o h\xf3spede sinta-se confort\xe1vel, com ambientes sofisticados.\n\nOs 120 apartamentos s\xe3o confort\xe1veis, oferecem uma decora\xe7\xe3o clean, isolamento ac\xfastico e t\xe9rmico, com instala\xe7\xf5es especiais para deficientes f\xedsicos. Todos os quartos s\xe3o equipados com TV a cabo, ar condicionado split, frigobar e internet banda larga. Para melhor conforto, as janelas s\xe3o anti-ru\xeddo, proporcionando sempre uma noite de sono tranquila.\n\nO Executive Inn tamb\xe9m oferece um business center equipado, que serve como sala de reuni\xf5es para at\xe9 seis pessoas. Al\xe9m disso, tr\xeas salas de conven\xe7\xf5es com capacidade para at\xe9 240 pessoas completam a \xf3tima estrutura de neg\xf3cios. As salas oferecem acesso \xe0 internet banda larga e internet wireless e equipamentos para loca\xe7\xe3o.\n\nMostrando preocupa\xe7\xe3o com o bem-estar dos h\xf3spedes, o hotel oferece servi\xe7o de quarto 24 horas, bar, sala de gin\xe1stica, estacionamento coberto com manobrista, loja de conveni\xeancia e m\xe1quinas de auto-atendimento.\n\nHospede-se com sofistica\xe7\xe3o e praticidade no Executive Inn Hotel, uma das melhores op\xe7\xf5es de hospedagem em Uberl\xe2ndia.","assets/works/ic_executive_inn_hotel.png","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel1194","Executive Inn Hotel"),A.aT("Rede Brisa de Hot\xe9is em Macei\xf3, conforto, modernidade e muito prazer para quem se hospeda a lazer ou a neg\xf3cios. Nossa Rede conta com cinco excelentes empreendimentos para que voc\xea possa desfrutar ao m\xe1ximo a sua estada em Macei\xf3. Conhe\xe7a cada um deles e se apaixone.\n\nO Hotel Brisa Tower est\xe1 situado na sofisticada praia de Jati\xfaca, a poucos minutos do centro da cidade.\nO Brisa Mar Hotel, em Macei\xf3, est\xe1 localizado em frente ao mar, na Praia de Paju\xe7ara;\nO Hotel Costamar hospeda voc\xea na praia de Ponta Verde;\nO Hotel Praia Bonita possui localiza\xe7\xe3o expendida, na bela praia de Paju\xe7ara;\nO Hotel Praia Bonita Jati\xfaca localiza-se na bela praia da Jati\xfaca.\n\nTodos os empreendimentos da Rede Brisa de Hot\xe9is contam com uma infraestrutura moderna e aconchegante, perfeita para quem quer sair da rotina, descansar e vivenciar seus compromissos com a certeza de conforto.","assets/works/ic_rede_brisa_hoteis.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.chain77","Rede Brisa Hot\xe9is"),A.aT("O Imperial Hotel est\xe1 localizado no bairro do Catete, ao lado da esta\xe7\xe3o do metr\xf4 do Catete, na frente do Pal\xe1cio do Catete e a menos de 300 metros da Praia e Aterro do Flamengo.\n\nO hotel disp\xf5e de caf\xe9 da manh\xe3 incluso na di\xe1ria, piscina ao ar livre, estacionamento gratuito e internet wi-fi (com custo adicional), al\xe9m de recep\xe7\xe3o 24 horas.\n\nOferece apartamentos equipados com frigobar, TV a cabo, cofre, ar condicionado, e algumas categorias ainda oferecem banheira de hidromassagem e maior espa\xe7o de circula\xe7\xe3o.\n\nO Imperial Hotel \xe9 uma \xf3tima op\xe7\xe3o de hospedagem no Rio de Janeiro, seja a neg\xf3cios ou a lazer.","assets/works/ic_imperial_hotel.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel4720","Imperial Hotel"),A.aT("O Hotel Brasil Tropical est\xe1 localizado em Fortaleza, na Avenida Aboli\xe7\xe3o garante f\xe1cil acesso ao Shopping Del Paseo e a feira de artesanatos que est\xe3o a 1 km, o Museu de Artes de Fortaleza est\xe1 a 3km e o Aeroporto Pinto Martins est\xe1 a 9 km de dist\xe2ncia.\n\nAs acomoda\xe7\xf5es s\xe3o confort\xe1veis e oferecem varanda privativa com vista panor\xe2mica da cidade, incluem uma mini-cozinha, ar-condicionado e TV a cabo. O hotel ainda oferece Wi-Fi e estacionamento.\n\nPara os momentos de lazer o Hotel Brasil Tropical possui a cobertura com piscina e vista panor\xe2mica para o mar, servi\xe7os de massagem e restaurante.\n\nO restaurante do Hotel Brasil Tropical serve cozinha internacional, e oferece um festival de camar\xe3o \xe0s quartas-feiras. O buffet de caf\xe9-da-manh\xe3 \xe9 servido diariamente e inclui croissants, sucos naturais e bolos frescos.\n\nVenha para Fortaleza e conhe\xe7a o Hotel Brasil Tropical sua viagem ser\xe1 inesquec\xedvel!","assets/works/ic_brasil_tropical_hotel.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel1523","Brasil Tropical Hotel"),A.aT("De frente para praia da Barra da Tijuca, o Brisa Barra Hotel oferece uma hospedagem com muita praticidade e conforto para quem vem a cidade, tanto para turismo quanto para neg\xf3cios. Pr\xf3ximo a grandes empresas e centros comerciais da regi\xe3o, como o Barra Shopping e o Centro de Conven\xe7\xf5es do RioCentro, o hotel fica a 28km do Aeroporto Internacional Santos Dumont.\n\nS\xe3o 140 apartamentos amplos, equipados com ar condicionado, dois ramais de telefone, minibar, cofre eletr\xf4nico, TV a cabo, banheiros com espelho de maquiagem, secador de cabelos e em algumas unidades hidromassagem. 98% dos apartamentos possuem varanda. Conte tamb\xe9m com servi\xe7o de quarto e praia, lavanderia, mensageiros e profissionais bil\xedngue para melhor atend\xea-lo.\n\nO Hotel conta com internet Wi-Fi de 2MB free e internet Wi-Fi de 10 MB por R$ 20,00 + 5%ISS a di\xe1ria.\n\nPara o lazer voc\xea poder\xe1 desfrutar de duas piscinas, sendo uma especial para crian\xe7as, sauna seca e a vapor, sala de gin\xe1stica, bar e um sal\xe3o de eventos equipado com uma estrutura \xf3tima.\n\nConhe\xe7a tamb\xe9m o restaurante do hotel e deguste os mais variados pratos, tanto no caf\xe9-da-manh\xe3, como no almo\xe7o ou jantar.\n\nTenha uma estadia tranquila no Brisa Barra Hotel e conhe\xe7a uma das praias mais bonitas do Rio de Janeiro!","assets/works/ic_brisa_barra_hotel.png","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel2934","Brisa Barra Hotel"),A.aT("O Hotel Feller Avenida Paulista est\xe1 localizado a 50 metros da Avenida Paulista e da esta\xe7\xe3o de Metr\xf4 Brigadeiro. A localiza\xe7\xe3o \xe9 privilegiada e caracterizada como o principal centro financeiro do Brasil. Est\xe1 inserido em uma regi\xe3o rica em cultura e entretenimento, pr\xf3ximo aos principais pontos tur\xedsticos de S\xe3o Paulo, o Hotel Feller Avenida Paulista est\xe1 a poucos minutos dos principais teatros da cidade, Museu de Arte de S\xe3o Paulo (MASP), cinemas, shoppings, centros culturais, restaurantes e caf\xe9s. Com r\xe1pido acesso a metr\xf4 e pontos de \xf4nibus executivos, a circula\xe7\xe3o do h\xf3spede fica f\xe1cil e acess\xedvel.\n\nOs quartos s\xe3o espa\xe7osos e modernos, com varanda privativa e vidros anti-ru\xeddos, os apartamentos s\xe3o equipados com TV LCD a cabo, ar condicionado, cofre eletr\xf4nico, cama king size e frigobar. Para conforto dos h\xf3spedes oferecemos acesso \xe0 internet Wifi gr\xe1tis e servi\xe7o de room service. Na categoria Master os amenities s\xe3o diferenciados e personalizados, o caf\xe9 da manh\xe3 pode ser servido no quarto e o h\xf3spede pode escolher um jornal de prefer\xeancia.\n\nTodos os h\xf3spedes tem a disposi\xe7\xe3o o servi\xe7o de acesso online a jornais. S\xe3o mais de 3.000 jornais completos e atualizados de todo o mundo para acessar atrav\xe9s do tablet ou smartphone durante a estadia no Hotel Feller Avenida Paulista.\n\nNa cobertura do hotel o h\xf3spede tem acesso \xe0 piscina, espa\xe7o fitness, sauna e espa\xe7o gourmet, tudo acompanhado com uma \xf3tima vista da cidade.\n\nO buffet de caf\xe9 da manh\xe3 servido diariamente oferece uma variedade de frutas frescas, p\xe3es e frios. Voc\xea pode desfrutar de especialidades internacionais e uma sele\xe7\xe3o de bebidas, no almo\xe7o e no jantar.\n\nO Hotel Feller Avenida Paulista fica a poucos minutos do Parque Ibirapuera e a 20 minutos do Aeroporto de Congonhas.","assets/works/ic_feller_paulista_hotel.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel1683","Feller Paulista Hotel"),A.aT("O Grupo Viale \xe9 um dos nomes mais reconhecidos em Foz do Igua\xe7u como um dos l\xedderes de estilo e inova\xe7\xe3o em hotelaria. Depois do Viale Cataratas, que trouxe uma nova abordagem em produtos, comodidades e servi\xe7o com seu design inteligente tanto para o lazer quanto para neg\xf3cio, o grupo inaugurou o Viale Tower, o mais novo, confort\xe1vel e moderno hotel em sua categoria da Terra das Cataratas.\n\nMais do que uma marca reconhecida, os hot\xe9is Viale tem o compromisso de oferecer uma hospitalidade aut\xeantica para tornar mais f\xe1cil e gratificante a viagem para h\xf3spedes de todos os lugares do planeta que visitam um dos mais belos destinos do mundo!","assets/works/ic_viale_hotels.webp","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.chain515","Viale Hotels"),A.aT("O Vilamar Copacabana, localizado a menos 100 metros da praia de Copacabana, oferece uma estrutura completa para seus h\xf3spedes.\n\nO hotel possui 70 apartamentos climatizados, com piso de madeira e equipados com ar condicionado, frigobar, som ambiente, cofre, TV \xe0 cabo, secador de cabelo, e alguns apartamentos ainda dispo\u1ebdm de banheira de hidromassagem.\n\nLocalizado em uma \xe1rea nobre da cidade do Rio de Janeiro, tem f\xe1cil acesso aos aeroportos, cinemas e shoppings, e \xe9 poss\xedvel chegar ao centro da cidade em menos de 10 minutos utilizando o metr\xf4, que fica a tr\xeas quadras do hotel. O hotel ainda oferece estacionamento, dispon\xedvel por um custo adicional.\n\nConta com um espa\xe7o fitness,sauna, piscina ao ar livre, internet wi-fi lobby bar, caf\xe9 da manh\xe3 incluso na di\xe1ria (servido no restaurante), recep\xe7\xe3o 24 horas, e no terra\xe7o do hotel \xe9 poss\xedvel vizualizar o P\xe3o de A\xe7\xfacar.","assets/works/ic_hotel_vilamar_copacabana.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel4659","Hotel Vilamar Copacabana"),A.aT("O Hotel Caravelle localiza-se no centro de Curitiba ao lado de v\xe1rias atra\xe7\xf5es famosas como Rua 24 horas, Catedral de Curitiba, Rua das Flores e Pal\xe1cio Avenida (Bradesco). Tamb\xe9m est\xe1 pr\xf3ximo ao Teatro Gua\xedra, Cal\xe7ad\xe3o da Rua XV e aos Shoppings Mueller e Curitiba.\n\nOs apartamentos s\xe3o confort\xe1veis e est\xe3o equipados com cama box spring, frigobar, piso antial\xe9rgico, secador de cabelo, telefone e TV a cabo. As categorias Luxo e Executivo possuem tamb\xe9m ar condicionado e internet. Al\xe9m disso, est\xe3o dispon\xedveis quartos para n\xe3o fumantes e adaptados para pessoas portadoras de necessidades.\n\nNo restaurante Stravaganzza \xe9 oferecido um caf\xe9 da manh\xe3, que j\xe1 est\xe1 incluso na di\xe1ria e o h\xf3spede tamb\xe9m poder\xe1 desfrutar de um card\xe1pio pago \xe0 La Carte ou buffet.\n\nO Hotel tamb\xe9m disp\xf5e de \xe1rea de lazer e eventos, al\xe9m de churrasqueira e sala de TV, possui cinco salas para eventos e reuni\xf5es sociais que comportam de 20 \xe0 300 pessoas em audit\xf3rio.","assets/works/ic_caravelle_palace_hotel.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel1146","Caravelle Palace Hotel"),A.aT("Situado entre paisagens exuberantes de jardins tropicais O Hibiscus Beach Pousada est\xe1 localizado a apenas 100 metros da Praia Jo\xe3o Fernandes e oferece uma experi\xeancia \xfanica em uma praia com calmas \xe1guas cristalinas, areias douradas e excelentes restaurantes em meio a ex\xf3ticas palmeiras.\n\nTodas as su\xedtes t\xeam varanda com uma maravilhosa vista para o mar. Os quartos s\xe3o amplos e totalmente equipados, com ar condicionado, TV, Frigobar e cofre individual. Os bangal\xf4s tem cama de casal ou solteiro e uma pequena sala. Os banheiros s\xe3o amplos, funcionais e confort\xe1veis. Na \xe1rea externa \xe9 poss\xedvel desfrutar de uma piscina.\n\nA pousada ainda conta com uma bela sala de jantar onde o buffet de caf\xe9-da-manh\xe3 \xe9 servido todas as manh\xe3s, com uma variedade incr\xedvel.Voc\xea tamb\xe9m pode contar com um business center e todo o apoio e hospitalidade dos funcion\xe1rios da pousada que ir\xe3o te ajudar a escolher os melhores passeios para conhecer as maravilhas de b\xfazios","assets/works/ic_pousada_hibiscus_beach.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel5212","Pousada Hibiscus Beach"),A.aT("Situado no centro do Rio de Janeiro, o Hostel est\xe1 pr\xf3ximo ao Samb\xf3dromo e do bairro da Lapa. Fica a poucos metros da Av. Get\xfalio Vargas e da Pra\xe7a Cruz Vermelha. Oferece hospedagem econ\xf4mica e \xe9 ideal para mochileiros.\n\nOs quartos s\xe3o simples e est\xe3o equipados com ventilador de teto, piso antial\xe9rgico, camas box, TV, internet gratuita, banheiro compartilhado e arm\xe1rio. Os apartamentos duplos ou triplos incluem tamb\xe9m um banheiro privativo e ar condicionado.","assets/works/ic_hotel_hostel_villa_santana.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel1730","Hotel & Hostel Villa Santana"),A.aT("Localizado a apenas 5 minutos de carro da Esplanada dos Minist\xe9rios e a 15 minutos do Aeroporto Juscelino Kubitschek, o Garvey Park Hotel apresenta uma estrutura completa e oferece os melhores servi\xe7os da regi\xe3o.\n\nTodas as 80 acomoda\xe7\xf5es est\xe3o equipadas com TV a cabo, ar condicionado, frigobar, acesso \xe0 internet Wi-Fi gratuito e banheiro privativo. Para lazer e bem estar de seus h\xf3spedes, a propriedade disponibiliza uma piscina ao ar livre, bar e servi\xe7os de massagem. Para maior comodidade, h\xe1 um restaurante interno onde s\xe3o servidas refei\xe7\xf5es para almo\xe7o e jantar. O estacionamento est\xe1 dispon\xedvel e possui custo adicional.\n\nPerfeito para estadas a neg\xf3cios, o Garvey Park Hotel \xe9 a op\xe7\xe3o certa para quem quer conforto e servi\xe7os de qualidade. Aproveite o melhor que Bras\xedlia tem a oferece e confira as vantagens de se hospedar neste excelente hotel.","assets/works/ic_garvey_park_hotel.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel4299","Garvey Park Hotel"),A.aT("Localizado a apenas uma quadra da Esta\xe7\xe3o de Metr\xf4 da Gl\xf3ria, a 10 minutos da rodovi\xe1ria, e a 20 minutos de carro do Aeroporto Santos Dumont, o Metr\xf3pole Rio Hotel \xe9 a op\xe7\xe3o certa para quem vai ao Rio de Janeiro em busca de uma estrutura completa e servi\xe7os de qualidade.\n\nTodas as acomoda\xe7\xf5es s\xe3o confort\xe1veis e oferecem ar condicionado, TV a cabo, cofre, telefone, frigobar, acesso gratuito \xe0 internet Wi-Fi e banheiro privativo. Para maior comodidade de seus h\xf3spedes, o Restaurante & Bar Paladino serve refei\xe7\xf5es como lanches, almo\xe7o, jantar e um completo buffet de caf\xe9 da manh\xe3 diariamente.\n\nVisando um atendimento ainda mais completo, o hotel disp\xf5e de funcion\xe1rios bilingues, estacionamento cortesia, servi\xe7o de quarto e recep\xe7\xe3o 24 horas. Conhe\xe7a os benef\xedcios de se hospedar no Metr\xf3pole Rio Hotel pela MalaPronta.com!","assets/works/ic_metropole_rio_hotel.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel1939","Metr\xf3pole Rio Hotel"),A.aT("O Hotel Rond\xf4nia Palace est\xe1 localizado a apenas alguns passos do centro do Rio de Janeiro, pr\xf3ximo \xe0 Praia do Flamengo e a 10 minutos da famosa Praia de Copacabana. Sua estrutura \xe9 completa e seus servi\xe7os s\xe3o pr\xe1ticos.\n\nOs apartamentos s\xe3o muito confort\xe1veis e est\xe3o equipados com ar condicionado, TV a cabo, frigobar, telefone, r\xe1dio, banheiro privativo e acesso gratuito \xe0 internet Wi-Fi. Para maior comodidade de seus h\xf3spedes, o restaurante do hotel serve diariamente um buffet de caf\xe9 da manh\xe3, al\xe9m de refei\xe7\xf5es para almo\xe7o e jantar. Al\xe9m disso, o local disponibiliza um espa\xe7o para eventos e conven\xe7\xf5es com capacidade para 70 pessoas. Ou seja, o Hotel Rond\xf4nia Palace \xe9 perfeito tanto para viajantes a lazer, como a neg\xf3cios.\n\nAproveite o melhor que a Cidade Maravilhosa tem a oferecer hospedado em um hotel de bom gosto, excelente localiza\xe7\xe3o e \xf3timos servi\xe7os. Conhe\xe7a os benef\xedcios de se hospedar no Hotel Rond\xf4nia Palace.","assets/works/ic_hotel_rondonia_palace.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel1251","Hotel Rond\xf4nia Palace"),A.aT("O Hotel Villa Rica se encontra no centro da Cidade Maravilhosa, pr\xf3ximo aos principais pontos de interesse da cidade, como os Arcos da Lapa, o Museu de Arte Moderna e o Aeroporto Santos Dumont.\n\nTodos os apartamentos s\xe3o rec\xe9m reformados e est\xe3o equipados com ar condicionado, telefone, frigobar, TV a cabo, banheiro privativo e acesso gratuito \xe0 internet Wi-Fi. Para maior comodidade, o restaurante do hotel serve diariamente um delicioso e completo buffet de caf\xe9 da manh\xe3. O estacionamento est\xe1 dispon\xedvel e \xe9 cortesia.\n\nA miss\xe3o do Hotel Villa Rica \xe9 proporcionar conforto na hospedagem de seus h\xf3spedes e oferecer servi\xe7os pr\xe1ticos de qualidade. Fa\xe7a sua reserva e desfrute de \xf3timos momentos no Rio de Janeiro.","assets/works/ic_hotel_villa_rica.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel652","Hotel Villa Rica"),A.aT("Localizado em Belo Horizonte, o Hotel Sol situa-se a 6 km do Parque Municipal das Mangabeiras e fica pr\xf3ximo a Av. Afonso Pena. A dist\xe2ncia at\xe9 o Aeroporto Carlos Prates \xe9 de 8 km.\n\nOs apartamentos s\xe3o amplos e est\xe3o equipados com TV a cabo, internet, frigobar e ar condicionado. Est\xe3o dispon\xedveis quartos para n\xe3o fumantes e adaptados para pessoas com mobilidade reduzida.\n\nA estrutura de lazer possui piscina, sauna e sala de fitness. O hotel oferece restaurante, business center, lavanderia, caf\xe9 da manh\xe3 no quarto e recep\xe7\xe3o 24 horas.","assets/works/ic_hotel_sol_belo_horizonte.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel3427","Hotel Sol Belo Horizonte"),A.aT("Com \xf3tima localiza\xe7\xe3o em Foz do Igua\xe7u, o Carim\xe3 Resort Hotel & Convention fica na parte nobre da cidade, a apenas 5 km do Aeroporto Internacional de Foz do Igua\xe7u e com f\xe1cil acesso \xe0s Cataratas.\n\nSuas acomoda\xe7\xf5es s\xe3o amplas e confort\xe1veis, oferecendo noites de descanso e tranquilidade durante seus dias na cidade. Os 318 apartamentos est\xe3o equipados com ar condicionado, TV a cabo, frigobar, secador de cabelos, telefone e acesso pago \xe0 internet.\n\nDurante suas refei\xe7\xf5es, os h\xf3spedes podem degustar as maravilhas dos restaurantes Royale e Picadilly, localizado nas depend\xeancias do hotel. Sob responsabilidade de chefs renomados, s\xe3o preparadas refei\xe7\xf5es tradicionais da culin\xe1ria brasileira e um menu completo da cozinha internacional. Os dois restaurantes possuem capacidade para at\xe9 500 pessoas e funcionam com os sistemas de buffet e \xe0 la carte.\n\nNa hora da divers\xe3o, os h\xf3spedes t\xeam \xe0 sua disposi\xe7\xe3o uma estrutura completa, em meio \xe0 natureza, com quadras de t\xeanis, de basquete, campo de futebol, playgroud e piscinas. Para aqueles que gostam de um contato maior com a natureza, h\xe1 bosques, trilhas para caminhada e dois lagos que ir\xe3o garantir \xf3timos momentos ao lado de sua fam\xedlia.\n\nSe voc\xea busca um local apropriado para a realiza\xe7\xe3o de eventos, encontra no resort uma ampla \xe1rea com 10 mil m\xb2 para eventos, congressos e conven\xe7\xf5es. Com diversos sal\xf5es e salas de apoio, voc\xea pode realizar os mais variados tipos de eventos e com certeza ter\xe1 grande sucesso.\n\nQuando estiver em Foz do Igua\xe7u, n\xe3o deixe de conhecer o maior hotel do Paran\xe1! Passe alguns dias no Carim\xe3 Resort Hotel & Convention e desfrute de \xf3timos momentos com a fam\xedlia e os amigos.","assets/works/ic_carima_hotel_convention.png","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel1177","Carim\xe3 Hotel Convention"),A.aT("O Continental Inn Hotel \xe9 a melhor op\xe7\xe3o para quem aprecia hospedar-se com requinte, conforto e \xf3timo atendimento.\n\nLocalizado na \xe1rea mais elegante do centro de Foz do Igua\xe7u, o Continental Inn \xe9 um inovador complexo hoteleiro, onde todos os detalhes foram cuidadosamente elaborados, a fim surpreender at\xe9 mesmo aos h\xf3spedes mais exigentes.\n\nCom ambientes modernos, requintados e agrad\xe1veis, o hotel oferece o que h\xe1 de melhor em infra-estrutura f\xedsica e de servi\xe7os. Seja em busca de descanso ou divers\xe3o, voc\xea estar\xe1 no lugar certo. N\xe3o deixe de conhecer!\n\nO Continental Inn espera por sua chegada. Com certeza voc\xea voltar\xe1 pra casa com muitas hist\xf3rias para contar!","assets/works/ic_hotel_continental_inn.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel413","Hotel Continental Inn"),A.aT("O Lizon Curitiba Hotel situa-se em Curitiba, em \xf3tima localiza\xe7\xe3o na Avenida 7 de setembro, e tem f\xe1cil acesso aos principais pontos tur\xedsticos da cidade como o Jardim Bot\xe2nico e o Teatro Gua\xedra.\n\nAs 78 acomoda\xe7\xf5es do Lizon, amplas e simples, est\xe3o equipadas com ar condicionado, bancada para trabalho, cama box spring, cofre, frigobar, piso antial\xe9rgico, secador de cabelo, telefone e TV a cabo. Al\xe9m disso, algumas acomoda\xe7\xf5es s\xe3o especialmente equipadas para pessoas com necessidades e n\xe3o fumantes.\n\nOs momentos de lazer podem ser aproveitados dentro do Hotel, com um pequeno custo extra, o h\xf3spede pode cuidar do corpo na academia com solarium, relaxar na hidromassagem ou at\xe9 mesmo descansar na sauna \xfamida. O hotel tamb\xe9m conta com um bar.\n\nO Hotel possui centro de conven\xe7\xf5es com capacidade de at\xe9 300 pessoas para eventos empresariais e sociais, com todo o apoio necess\xe1rio para um evento de sucesso.","assets/works/ic_lizon_curitiba_hotel.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel328","Lizon Curitiba Hotel"),A.aT("A Slaviero Hot\xe9is, com mais de 30 anos de hist\xf3ria, a Slaviero Hot\xe9is virou refer\xeancia no mercado da hotelaria apresentando alta qualidade de servi\xe7os e comprometimento com o bem-estar de seush\xf3spedes. Ap\xf3s sua expans\xe3o na cidade de Curitiba, onde foi inaugurado o primeiro hotel da rede em 1981, a Slaviero Hot\xe9is ampliou sua presen\xe7a no pa\xeds e est\xe1 presente em dezesseis cidades e cincoestados brasileiros, com ambiciosos planos de expans\xe3o, somando atualmente 33 empreendimentos, desses, 24 em funcionamento. Os hot\xe9is contam ainda com uma excelente estrutura para eventos de todos ostamanhos, oferecendo localiza\xe7\xf5es estrat\xe9gicas, salas climatizadas e preparadas para todas as necessidades.","assets/works/ic_slaviero_hoteis.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.chain12","Slaviero Hot\xe9is"),A.aT("O Hotel Rainha do Brasil encontra-se em Aparecida, S\xe3o Paulo, a 700 metros do Santu\xe1rio Nacional de Aparecida, sendo \xf3tima op\xe7\xe3o de hospedagem para os romeiros. O aeroporto de S\xe3o Jos\xe9 dos Camposest\xe1 a 81,2 km, pouco mais de 1 hora de carro. O acesso ao Hotel pode ser facilmente realizado pela Rodovia Presidente Dutra.As acomoda\xe7\xf5es do Hotel s\xe3o amplas, muito charmosas, possuem m\xf3veis novos e sob medida. Est\xe3o equipadas com piso antial\xe9rgico, ar condicionado, cofre, internet gratuita, TV a cabo, telefone,frigobar e uma bancada para trabalho. O Hotel oferece apartamentos antial\xe9rgicos, adaptados para pessoas com necessidades e \xe9 proibido fumar.Na estrutura de lazer e descanso o h\xf3spede encontra sala de academia, bar, sauna, piscina e sala de jogos. As crian\xe7as tem um espa\xe7o especial com um parquinho cercado e sala com brinquedos ejogos. Na \xe1rea externa o h\xf3spede pode desfrutar de um lindo jardim com lagos e quiosques.O estacionamento e acesso a internet WI-FI s\xe3o cortesia do Hotel, o caf\xe9 da manh\xe3 est\xe1 incluso na di\xe1ria e para as outras refei\xe7\xf5es voc\xea pode optar pelo Restaurante do Hotel com servi\xe7o de buffetou sugest\xe3o do Chef.H\xe1 uma capela interna no Hotel, com capacidade para 20 pessoas, e outra externa, com capacidade para at\xe9 300 pessoas.Obs.: O Hotel disp\xf5e de transfer in/out para o Santu\xe1rio e visita noturna com guia, focando as artes sacras.","assets/works/ic_hotel_rainha_do_brasil.jpg","https://play.google.com/store/apps/details?id=br.com.malapronta.hotelapp.hotel3985","Hotel Rainha do Brasil")],H.R("u<zI>"))})
